import React, { useState } from 'react';
import './loginForm.css'

function LoginForm() {
  const [token, setToken] = useState('');

  function handleSubmit(event) {
    event.preventDefault();
    // Send the token to a server or do something else with it here
  }

  return (
	<div class="css-1ihmcwn">
	<div class="chakra-stack css-1jwo2z">

	<div class="chakra-stack css-84zodg">
	<button type="button" class="chakra-button css-1scs2e0">
	<span class="chakra-button__icon css-1wh2kri">
	<svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 24 24" aria-hidden="true" focusable="false" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg">
	<path d="M21 11H6.414l5.293-5.293-1.414-1.414L2.586 12l7.707 7.707 1.414-1.414L6.414 13H21z"></path></svg>
	</span>Go back</button></div>
	<div class="chakra-stack css-1kn39y0">
	<div class="chakra-stack css-84zodg">
	<img alt="versitech logo" src="/static/media/versitech.ed4222a3c84377ac8cbb.png" class="chakra-image css-l0hycr"/></div>
	<p class="chakra-text css-10l1sat">Check your email for your verification code.</p></div>
	<div class="css-10cu6y1">
	<div class="chakra-stack css-egoftb"><div role="group" class="chakra-form-control css-1kxonj9"><label id="resettoken-label" for="resettoken" class="chakra-form__label css-2gx1h6">Token</label>
	<input type="text" name="resettoken" placeholder="token" id="resettoken" class="chakra-input css-1c6j008" value=""/></div>
	<div class="chakra-stack css-1au6mu0">
	<div class="css-gmuwbf"><a href='#'>did not recieve any code? Click to resend verification token.</a></div>
	<button  type="button" class="chakra-button css-13gwdbl">Verify</button>
	</div>
	</div>
	</div>
	</div>
	</div>

  );
}

export default LoginForm;
